	// 		<Route path="/" element={<Register />} />
	// 		<Route path="register" element={<Register />} />
	// 		<Route path="login" element={<Login />} />
	// 	</Routes>
	// )
	return useRoutes([
		{
			path: "auth",
			children: [
				{
					path: "/",
					element: <Register />,
				},
				{
					path: "/register",
					element: <Register />,
				},
			],
		},
	])
}
